              <Icon sx={{ color: 'rgb(103, 116, 142)' }}>edit</Icon>
            </ArgonButton>
          </ArgonBox>
          <ArgonButton variant="text" color="error">
            <Icon sx={{ color: 'rgb(103, 116, 142)' }}>delete</Icon>
          </ArgonButton>
        </ArgonBox>
      ),
      map: <LocationButton location="Transcorp Hilton, Maitama, Abuja" hotelName="Transcorp Hilton" />,
    },
    {
      hotel: <Hotel image={hotelImage2} name="Sheraton Hotel" />,
