      ),
      map: <LocationButton location="Sheraton Hotel, Wuse, Abuja" hotelName="Sheraton Hotel" />,
    },
    {
      hotel: <Hotel image={hotelImage3} name="Fraser Suites" />,
      type: (
        <ArgonTypography variant="caption" color="text" fontWeight="regular">
